import React from 'react';
import './App.css';

function App() {
  const count = [1,2,3,4,5];
  return (
    <div className="App">
      <h1>Hello, React!</h1>
      <p>I am learning React.</p>
      <ul>
       {count.map((items) => (
        <li key={items}> {items} </li>
       ))}
      </ul>
    </div>
  );
}
export default App;
